package com.corejava;

public class Solid_Rectangle {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
			int n = 4;
			int m = 5;
			//outer Loop
			for(int i=1; i<=n; i++) {
				//Inner Loop
				for(int j=1; j<=m; j++) {
					System.out.print("*"+" ");
				}
				System.out.println();
			}


	}

}
